import{_ as t,o as e,c as a,O as i}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 33.2-3800 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/33.2-3800.md","filePath":"vacode/33.2-3800.md"}'),o={name:"vacode/33.2-3800.md"},r=i('<h1 id="§-33-2-3800-definitions" tabindex="-1">§ 33.2-3800 Definitions. <a class="header-anchor" href="#§-33-2-3800-definitions" aria-label="Permalink to &quot;§ 33.2-3800 Definitions.&quot;">​</a></h1><p>As used in this chapter, unless the context requires a different meaning:</p><p>&quot;Authority&quot; means a regional passenger rail station authority created pursuant to this chapter.</p><p>&quot;Board&quot; means the board of directors of the authority.</p><p>&quot;Facility&quot; means any structure, including real estate and improvements, used for operating passenger rail service and complementary activities. &quot;Facility&quot; includes structures that are not owned by the authority or its members but are subject to a cooperative arrangement pursuant to subdivision 13 of § <a href="/vacode/15.2-6405/">15.2-6405</a>.</p><p>&quot;Governing bodies&quot; means the county boards of supervisors, city and town councils, and boards of visitors of institutions of higher education that are members of the authority.</p><p>&quot;Members&quot; means the counties, cities, towns, and institutions of higher education that comprise the authority.</p><p>&quot;Region&quot; means Planning District 4.</p><p>2021, Sp. Sess. I, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0353" target="_blank" rel="noreferrer">353</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0354" target="_blank" rel="noreferrer">354</a>.</p>',9),n=[r];function s(c,u,p,d,h,l){return e(),a("div",null,n)}const m=t(o,[["render",s]]);export{_ as __pageData,m as default};
